import React from "react";
import { Variables } from "./Variables";



function Customer() {

    const [nameList,setNameList] = useState([
        {
            id :1,
            name :{title:'mr',first:'Rangana',last:'Dilhara'}
        },
        {
            id :2,
            name :{title:'mr',first:'heshan',last:'dasun'}
        },
        ]);

    return(<div><h3>This is Customer page</h3></div>)
}

export default Customer;
